import React from "react"
import "../style/Footer.css"

export default function Footer() {
    return (
        <footer className="footer">
            <p>Questions? Comments? Coffee chat? Contact me at hmoon@bu.edu</p>
            <img src="../static/github.svg" alt="github" />
        </footer>
    )
}
